import React, {useState} from 'react';
import './App.css';

const Header = () => {
    return(
       <div className="header">Hello me header</div>
    );
};
const Login = () => {
    return(
       <div className="login">Hello me login</div>
    );
};
const Sidebar = () => {
    return(
       <div className="sidebar">Hello me sidebar</div>
    );
};
const Content = () => {
    return(
       <div className="content">Hello me content</div>
    );
};

const Nav = () => {
    return(
       <div className="nav">Hello me nav</div>
    );
};

export default function App() {
  return (
    <div className='wrapper'>
        <div>Hello me app</div>
        <Header />
        <Login />
        <Nav />
        <Sidebar />
        <Content />
    </div>
  );
}
